import styled from "styled-components";
import '../App.css';
import Header from "../header/Header";

const  MainWindow = styled.div`
  background-color: white;
  display: flex;
  width: 600px;
  margin: 0 auto;
  p{  
    margin: unset;
  }
`

const Rules = () => {
  return (
  <>
    <Header/>
    <MainWindow>
      <p>Some text </p>
    </MainWindow>
  </>
  )
}

export default Rules;
